import React from 'react';
import CounterFn from './components/counterFn';
import Counter from './components/conuter';
import './App.css'

function App() {
  return (
    <div className="App">
      <header>
        <h1>Licznik React</h1>
      </header>
      <CounterFn />
      <Counter nazwa={'Klasowy'}/>
    </div>
  );
}

export default App;
